import React from 'react';
import {BrowserRouter, Routes, Route} from 'react-router-dom';
import LaptopList from './LaptopList';
import LapAdvisor from './LapAdvisor';
import Navbar from './Navbar';

function App() {
  return (
    // Arka plan rengini buradaki style ile veya CSS dosyasıyla verebilirsiniz
    <div style={styles.appContainer}>
       <BrowserRouter>
      <Navbar />
      <Routes>
        <Route path="/LapAdvisor" element={<LapAdvisor />} />
        <Route path="/LaptopList" element={<LaptopList />} />
      </Routes>
    </BrowserRouter>
      <div style={styles.content}>
        <h1 style={styles.title}>Hoş Geldiniz</h1>
        <p style={styles.paragraph}>
          Burada en popüler laptopları bulabilir ve inceleyebilirsiniz.
        </p>

        {/* Tüm Laptoplar listesi */}
        <LaptopList />
      </div>
    </div>
  );
}

const styles = {
  appContainer: {
    backgroundColor: '#f0f0f0', // Arka plan rengi
    minHeight: '100vh',         // Ekranın tamamını kapsasın
    margin: 0,
    padding: 0
  },
  content: {
    padding: '1rem 2rem'
  },
  title: {
    fontSize: '2rem',
    marginBottom: '1rem'
  },
  paragraph: {
    fontSize: '1.1rem',
    marginBottom: '2rem'
  }
};

export default App;
